"use strict";var navButton=document.querySelector(".navbar-toggler"),hamburger=document.querySelector(".icon-hamburger"),cross=document.querySelector(".icon-cross");navButton.addEventListener("click",function(){hamburger.classList.contains("show")?(hamburger.classList.add("hide"),hamburger.classList.remove("show"),cross.classList.add("show"),cross.classList.remove("hide")):(hamburger.classList.add("show"),hamburger.classList.remove("hide"),cross.classList.add("hide"),cross.classList.remove("show"))}),window.onload=function(){setTimeout(function(){document.querySelector(".fadeLoad").style.pointerEvents="auto",document.querySelector(".fadeLoad").style.opacity=1},100)};